"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pressure sores (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pressure-sores-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H31341896\">",
"      <span class=\"h1\">",
"       What are pressure sores?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pressures sores are areas of damage to your skin and the tissue under your skin caused by pressure. This can happen from sitting or lying in the same position for a very long time. &ldquo;Pressure ulcers&rdquo; and &ldquo;bedsores&rdquo; are other names for pressure sores.",
"     </p>",
"     <p>",
"      The most common places for pressure sores are where bone is close to the skin. These areas include the ankles, back, elbows, heels, and hips (",
"      <a class=\"graphic graphic_figure graphicRef81059 \" href=\"mobipreview.htm?6/45/6871\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31341911\">",
"      <span class=\"h1\">",
"       What does a pressure sore look like?",
"      </span>",
"      &nbsp;&mdash;&nbsp;At first, the sore looks like a red patch of skin. If it gets worse, the skin breaks and the sore looks like a reddish-pink, shallow crater.",
"     </p>",
"     <p>",
"      Some sores look like a blister and can burst. Some severe pressure sores are so deep, you can see muscle or bone. Deep sores can also form scabs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31341926\">",
"      <span class=\"h1\">",
"       Who is at risk of pressure sores?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pressure sores are most common in people who:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Are older",
"       </li>",
"       <li>",
"        Cannot move or shift around easily because of a medical problem",
"       </li>",
"       <li>",
"        Are in a hospital or nursing home",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31341941\">",
"      <span class=\"h1\">",
"       Can pressure sores be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are a few things you can do to keep from getting pressure sores.",
"     </p>",
"     <p>",
"      If you spend a lot of time in a bed or chair, you can lower your chances of getting pressure sores by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Turning your body at least every 2 hours (for example, from your back, to one side, then the other side)",
"       </li>",
"       <li>",
"        Lying with your upper body raised at a slight angle when you lie on your side. This puts less pressure on your hip bone",
"       </li>",
"       <li>",
"        Placing pillows or foam wedges between your ankles and knees. You can also place pillows or foam wedges under your ankles.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Using a special mattress or a pad that goes on top of your mattress might also help. These mattresses or pads can be made of gel, foam, air, water, or sheepskin. There are also special devices that automatically adjust the surface to help relieve pressure when you lie down.",
"     </p>",
"     <p>",
"      If you are in a wheelchair, you can lower your chances of pressure sores by:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Doing wheelchair &ldquo;pushups&rdquo; by using your arms to raise off the seat. Try to do this at least once every hour.",
"       </li>",
"       <li>",
"        Tilting your body forward or to the side so your bottom lifts off the seat at least once every hour",
"       </li>",
"       <li>",
"        Using a special seat cushion filled with air, gel, or foam",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Taking good care of your skin is also important for preventing pressure sores. To help keep your skin as healthy as possible, you should:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Check your skin regularly for signs of pressure sores.",
"       </li>",
"       <li>",
"        Have another person check areas that you cannot see.",
"       </li>",
"       <li>",
"        Clean your skin regularly with mild soap.",
"       </li>",
"       <li>",
"        Avoid using hot water to wash your skin.",
"       </li>",
"       <li>",
"        Rub your skin gently while bathing, especially over the bony areas.",
"       </li>",
"       <li>",
"        Use a moisturizing cream. This will help keep your skin from getting dry and flaky.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31341956\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if you see or feel any areas where the surface of the skin is broken.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H31341971\">",
"      <span class=\"h1\">",
"       How are pressure sores treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor will give you medicine to relieve pain and prevent infection. Your doctor or nurse can also give you special bandages to help the sores heal.",
"     </p>",
"     <p>",
"      Some people need surgery or other treatments to remove infected or dead tissue in the sore.",
"     </p>",
"     <p>",
"      Your doctor or nurse can also talk to you about any problems that might have caused your pressure sore. He or she might suggest changes to help keep you from getting pressure sores in the future.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H183923614\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?26/53/27475?source=see_link\">",
